import Container from 'react-bootstrap/Container';
import icon from '../icon.jpg';

export default function Skills() {
    return (
        <Container>
            <div id="test">
                <p>"Nothing to see here :"</p>
                <img src={icon} alt="Nices img" id="img"></img>
            </div>
        </Container>
    );
}
